import React from 'react';
import { BrowserRouter as Router, Route, Switch, Link } from 'react-router-dom';
import './App.css';

// 各ページのコンポーネントをインポート
import Page1_1_1 from './Page1_1_1';
// import Page1 from './Page1';
// import Page2 from './Page2';

function App() {
  return (
    <Router>
      <div className="App">
        <h1>目次ページ</h1>
        <nav>
          <ul>
            <li>
              <Link to="/">ホーム</Link>
            </li>
            <li>
              <Link to="/Page1_1_1">「マーケティング」ってどう考えればいいの？</Link>
            </li>
            {/* <li>
              <Link to="/page2">ページ2</Link>
            </li> */}
          </ul>
        </nav>

        <Switch>
          <Route path="/Page1_1_1" component={Page1-1-1} />
          {/* <Route path="/page2" component={Page2} /> */}
        </Switch>
      </div>
    </Router>
  );
}

export default App;
